import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

 def PDFDiagnostics = testRunner.testCase.testSuite.testCases["PDFDiagnostics"].testSteps["pdfDiagnostics"].getPropertyValue("Request")

 def inputFile=testRunner.testCase.testSuite.testCases["PDFDiagnostics"].getPropertyValue("inputFile")

 def xmlAdd= new XmlHolder(PDFDiagnostics)
 xmlAdd.setNodeValue("//adob:PDFDiagnostics/inputFile",inputFile)

 def newxmlGet= xmlAdd.getXml();
 //add xml detail
 testRunner.testCase.testSuite.testCases["PDFDiagnostics"].testSteps["pdfDiagnostics"].setPropertyValue("Request",newxmlGet)

 def getTestStep=testRunner.testCase.testSuite.testCases["PDFDiagnostics"].testSteps["pdfDiagnostics"]
 def contextPDFDiagnostics = new WsdlTestRunContext(getTestStep);
 getTestStep.run(testRunner,contextPDFDiagnostics)
 //Validation -
def getRes=testRunner.testCase.testSuite.testCases["PDFDiagnostics"].testSteps["pdfDiagnostics"].getPropertyValue("Response")
def Response= new XmlHolder(getRes)
def GetResponse= Response.getNodeValue("//PDFDiagnosticsReturn")

log.info GetResponse

assert GetResponse=="1"

